function animateFilter() {
    gsap.to(".open", {
        opacity: 1,
        stagger: .2,
        duration: .2
    })

}
function closeAnimateFilter() {
    gsap.to(".open", {
        opacity: 0,
        scale: 1,
        stagger: .2,
        duration: .2
    })

}

function setData(productInfo) {
    document.querySelector(".product").innerHTML = ""
    productInfo.forEach(ele => {

        let a = document.querySelector(".product")

        let div = document.createElement("div")
        div.setAttribute("class", "outer")

        let up = document.createElement("div")
        up.setAttribute("id", "up")

        div.appendChild(up)

        let img = document.createElement("img")
        img.setAttribute("src", ele.imgURL)

        up.appendChild(img)

        let down = document.createElement("div")
        down.setAttribute("id", "down")

        div.appendChild(down)

        let companyName = document.createElement("div")
        companyName.setAttribute("id", "companyName")
        down.appendChild(companyName)

        let cName = document.createElement("h1")
        cName.append(ele.company)

        companyName.appendChild(cName)

        let Name = document.createElement("div")
        Name.setAttribute("id", "name")

        down.appendChild(Name)

        let NamePara = document.createElement("p")
        NamePara.append(ele.name)
        Name.appendChild(NamePara)


        let prices = document.createElement("div")
        prices.setAttribute("id", "Price")

        let prH2 = document.createElement("h2")
        prH2.append(" ", ele.price)

        prices.appendChild(prH2)
        down.appendChild(prices)

        // let size = document.createElement("div")
        // size.setAttribute("id", "size")

        // let prsize = document.createElement("p")
        // prsize.append( "Size :",ele.size[0])

        // size.appendChild(prsize)
        // down.appendChild(size)

        let btn = document.createElement("button")
        btn.setAttribute("id", "btns")
        btn.append("SHOP")
        down.appendChild(btn)

        a.append(div)

    });

}
setData(data)

let filters = {
    minPrice: null,
    maxPrice: null,
    brand: null,
    companyName: null,
    companyid: null,
    Shoes_color: ["red", "blue", "black", "white"],
    sizeing: ['6', '7', '8', '9']
}

function filldata(quality, value) {
    if (value !== "") {
        filters[quality] = value;
    } else {
        filters[quality] = null;
    }
};

function checkedSize() {
    let sizeD = document.querySelectorAll(" .size input[type='radio']")
    console.log(sizeD);

    let sizeCollection = []
    sizeD.forEach((ele) => {
        if (ele.checked === true) {
            sizeCollection.push(ele.value)
        }
    })
    if (sizeCollection.length !== 0) {
        filters.sizeing = sizeCollection;
    }
}

function cheakedData() {
    let Event = document.querySelectorAll("input[type='checkbox']")
    console.log(Event);

    let SaveColor = []
    Event.forEach((ele) => {
        if (ele.checked === true)
            SaveColor.push(ele.name)
    })
    if (SaveColor.length !== 0) {
        filters.Shoes_color = SaveColor;
    }
    console.log(SaveColor);
};

function selectData() {
    let FilterArray = JSON.parse(JSON.stringify(data));

    if (filters.brand !== null) {
        FilterArray = FilterArray.filter((product) => {
            return product.name.toLowerCase().includes(filters.brand.toLowerCase())
        })
    }
    if (filters.minPrice !== null) {
        FilterArray = FilterArray.filter((product) => {
            return product.price >= filters.minPrice
        })
    }
    if (filters.maxPrice !== null) {
        FilterArray = FilterArray.filter((product) => {
            return product.price <= filters.maxPrice
        })
    }
    if (filters.companyName !== null) {
        FilterArray = FilterArray.filter((product) => {
            return product.company.toLowerCase() === filters.companyName.toLowerCase()
        })
    }

    if (filters.Shoes_color !== null) {
        FilterArray = FilterArray.filter((product) => {
            let isTrue = false;
            filters.Shoes_color.forEach((ele) => {
                product.color.forEach((colors) => {
                    if (colors.toLowerCase() === ele.toLowerCase()) {
                        isTrue = true
                    }
                })
            })
            if (isTrue) {
                return product
            }
            isTrue = false;
        })
    }

    if (filters.sizeing !== null) {
        FilterArray = FilterArray.filter((product) => {
            let isTrue = false;
            filters.sizeing.forEach((ele) => {
                product.size.forEach((size) => {
                    if (ele === size) {
                        isTrue = true
                    }
                })
            })
            if (isTrue)
                return product
        })
    }
    console.log(FilterArray);
    setData(FilterArray)
};
function display_All() {
    let FilterArr = data;

    if (filters.companyid !== null) {
        FilterArr = FilterArr.filter((product) => {
            return product.common_Id.toLowerCase().includes(filters.companyid.toLowerCase())
        })
    }
    if (filters.Shoes_color !== null) {
        FilterArr = FilterArr.filter((product) => {
            return product.color
        })
        console.log(FilterArr);
    }
    setData(FilterArr)
}
